import React from "react";
import { Link } from "react-router-dom";
import style from "./style.css";

export default function Header(params) {
  return (
    <header>
      <div>
        <Link to="#" className="link">
          Login
        </Link>
        <Link to="#">Register</Link>
      </div>
    </header>
  );
}
